import {
  createRouter,
  createWebHashHistory,
  NavigationGuardNext,
  RouteLocationNormalized,
  RouteRecordRaw,
} from 'vue-router';
import Home from '../views/home/center/index.vue';
import dataCenter from '@/dataCenter';
import { openModal } from '@/manager/view';
import LoginWidget from '@/views/home/login/Login.vue';
import { tokenController } from '@/manager/token';
const routes: Array<RouteRecordRaw> = [
  {
    path: '/',
    name: 'Home',
    component: Home,
  },
  {
    path: '/about',
    name: 'About',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () =>
      import(/* webpackChunkName: "about" */ '../views/About.vue'),
  },
  {
    path: '/casino',
    name: 'casino',
    component: () => import('../views/home/casino/index.vue'),

    children: [
      {
        path: 'dice',
        name: 'dice',
        component: () => import('../views/game/dice/Dice.vue'),
        props: true,
      },
      {
        path: 'limbo',
        name: 'limbo',
        component: () => import('@/games/limbo/index.vue'),
        props: true,
      },
      //三方游戏
      {
        path: 'PartyGames',
        name: 'PartyGames',
        component: () => import('@/views/home/other/PartyGames.vue'),
        props: true,
      },
    ],
  },
  {
    path: '/casino/originals',
    name: 'originals',
    component: () => import('../views/originals/Originals.vue'),
  },
  {
    path: '/casino/favorites',
    name: 'favorites',
    component: () => import('../views/originals/Originals.vue'),
  },
  {
    path: '/casino/recent',
    name: 'recent',
    component: () => import('../views/originals/Originals.vue'),
  },
  {
    path: '/Userprofe',
    name: 'Userprofe',
    component: () => import('@/views/home/head/right/MyUserAccount.vue'),
    props: true,
    meta: { requiresAuth: true }, // 添加元信息标记此路由需要验证
    children: [
      {
        path: 'Account',
        name: 'Account',
        component: () => import('@/views/home/head/right/MyAccThree.vue'),
        // 注意：这里是三级路由，在 `path` 的前面没有 `/`
      },
      {
        path: 'Sessions',
        name: 'Sessions',
        component: () => import('@/views/home/head/right/MyUserSessions.vue'),
      },
      {
        path: 'Verification',
        name: 'Verification',
        component: () => import('@/views/home/head/right/Verification.vue'),
      },
      {
        path: 'Transactions',
        name: 'Transactions',
        component: () =>
          import('@/views/home/head/user/UserTransactionsList.vue'),
      },
      {
        path: 'GameHistory',
        name: 'GameHistory',
        component: () =>
          import('@/views/home/head/user/UserGameHistoryList.vue'),
      },
    ],
  },
  //推广
  {
    path: '/referral',
    name: 'referral',
    component: () => import('@/views/ReferralProgram/index.vue'),
    meta: { requiresAuth: true },
    children: [
      {
        path: 'dashboard',
        name: 'dashboard',
        component: () =>
          import('@/views/ReferralProgram/ReferralDashboard.vue'),
      },
      {
        path: 'campaigns',
        name: 'campaigns',
        component: () =>
          import('@/views/ReferralProgram/ReferralCampaigns.vue'),
      },
      {
        path: 'referrals',
        name: 'referrals',
        component: () =>
          import('@/views/ReferralProgram/ReferralReferrals.vue'),
      },
    ],
  },
  // 竞赛
  {
    path: '/CompetitionDetails',
    name: 'CompetitionDetails',
    component: () => import('@/views/home/competition/CompetitionDetails.vue'),
  },

  //每日任务
  {
    path: '/daily-tasks',
    name: 'dailyTasks',
    component: () => import('@/views/dailyTasks/DailyTasks.vue'),
  },
  //公平性
  {
    path: '/Fair',
    name: 'Fair',
    component: () => import('@/views/home/other/Fair.vue'),
  },
  //团队
  {
    path: '/TeamIntroduction',
    name: 'TeamIntroduction',
    component: () =>
      import(
        /* webpackChunkName: "team-introduction" */ '@/views/home/other/TeamIntroduction.vue'
      ),
  },
  //最新新闻
  {
    path: '/LatestNews',
    name: 'LatestNews',
    component: () => import('@/views/home/other/LatestNews.vue'),
  },
  //新闻详情
  {
    path: '/NewsDetails:newsId',
    name: 'NewsDetails',
    component: () => import('@/views/home/other/widget/NewsDetails.vue'),
    props: true,
  },
  //vip
  {
    path: '/vip-club',
    name: 'vip-club',
    component: () => import('@/views/rankVip/index.vue'),
    props: true,
  },
  //三方体育
  {
    path: '/sports',
    name: 'sports',
    component: () => import('@/views/home/other/SportsGames.vue'),
    props: true,
  },
  //排行
  {
    path: '/ranking',
    name: 'ranking',
    component: () => import('@/views/rank/index.vue'),
    props: true,
  },
  //下载app
  {
    path: '/install-app',
    name: 'install-app',
    component: () => import('@/views/installApp/installApp.vue'),
    props: true,
  },
  //返现
  {
    path: '/cashback',
    name: 'cashback',
    component: () => import('@/views/cashback/index.vue'),
    props: true,
  },
  //返现
  {
    path: '/bonus-cabinet',
    name: 'bonus-cabinet',
    component: () => import('@/views/treasurebox/bonusCabinet.vue'),
    props: true,
  },
];

const router = createRouter({
  history: createWebHashHistory(),
  routes,
});
function checkLoginStatus(
  to: RouteLocationNormalized,
  next: NavigationGuardNext,
) {
  if (!tokenController.freshToken) {
    openModal(LoginWidget);
    next(false);
  } else {
    next();
  }
}
router.beforeEach((to, from, next) => {
  if (to.matched.some((record) => record.meta.requiresAuth)) {
    checkLoginStatus(to, next);
  } else {
    next();
  }
});
router.afterEach((to, from, next) => {
  const divElement = document.getElementById('main-content');
  // 将 div 滚动到顶部
  if (divElement) {
    divElement.scrollTop = 0;
  }
});

export default router;
